import { useNavigate } from 'react-router-dom';

const Create = () => {

    let navigate = useNavigate();

    return (
        <div id="create">
            <h1>THIS IS CREATE PAGE</h1>
            <button onClick={() => {
                navigate("/login");
            }}>Create</button>
        </div>
    );
};

export default Create;
